import "./App.css";
import { Link } from 'react-router-dom';
import About from "./components/About";
import Navbar from "./components/Navbar";
import Footer from "./components/Footer";
import Products from "./components/Products";

function App() {

  return (
    <>
      <Navbar></Navbar>
      <About></About>
      <Products></Products>
      <Footer></Footer>
    </>
  );
}

export default App;
